import React from 'react';
import Card from './Card';
import Sdata from './Sdata';

const favSeries = "netflix";


const FavS = () => {

if(favSeries === "netflix"){
    return(
        <Card   
            imgsrc ={Sdata[1].imgsrc}
            title ={Sdata[1].title}
            sname = {Sdata[1].sname}
            link={Sdata[1].link}/>
);
}else{
}
};



const App = () => ( 
<>
<h1 className="heading_style">List of top 5 Netflix series in 2020</h1>
<FavS/>
</>

);

export default App;
